import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';




const SellerNavBar = ({ responseData }) => {
    const navigate = useNavigate();
    
    const [responseData1, setResponseData1] = useState({});
    useEffect(() =>{
        setResponseData1(responseData);
        alert(responseData.token)

    },[])

    const handleAddItem = () => {

        // navigate(`/addItemForm?token=${responseData1}`);
        navigate('/addItemForm', { state: { responseData } });
      };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          Navbar
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNavDropdown"
          aria-controls="navbarNavDropdown"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"> </span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav">
            <li className="nav-item hover-zoom">
              <a
                className="nav-link active"
                aria-current="page"
                href="#"
              >
                <button
                  type="button"
                  className="btn btn-warning"
                  onClick={handleAddItem}
                  >Add New Item

                </button>

              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">
                <button type="button" className="btn btn-warning">
                  <Link
                    to={`/login`}
                    className="text-dark text-light text-decoration-none fs-6 font-weight-bold"
                  >
                    Log In
                  </Link>
                </button>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Pricing
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default SellerNavBar;
